		 //              <Nav.Link eventKey="second">Tab 1</Nav.Link>
		 //            </Nav.Item>
		 //            <Nav.Item>
		 //              <Nav.Link eventKey="third">Tab 1</Nav.Link>
		 //            </Nav.Item>
		 //          </Nav>
		 //        </Col>
		 //        <Col sm={9}>
		 //          <Tab.Content>
		 //            <Tab.Pane eventKey="first">
		 //              first content
		 //            </Tab.Pane>
		 //            <Tab.Pane eventKey="second">
		 //              second content
		 //            </Tab.Pane>
		 //            <Tab.Pane eventKey="third">
		 //              third content
		 //            </Tab.Pane>
		 //          </Tab.Content>
		 //        </Col>
		 //      </Row>
		 //    </Tab.Container>
	);
}

export default Navbar;
